	graphicalLods.arraySizes[0] = 0;
	bones.buf = NULL;
	bones.isAllocated = true;
	bones.elementSize = sizeof(BoneEntry_Type);
	bones.arraySizes[0] = 0;
	boneActors.buf = NULL;
	boneActors.isAllocated = true;
